INSERT INTO `article` VALUES (2,'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.','2019-12-24 09:45:50','What is Lorem Ipsum?','https://s3.eu-central-1.amazonaws.com/traderx/1577180748649-740812334.jpeg','kristopher_tillman'),(3,'Sanki yukseliyor. YTD','2019-12-24 12:05:28','Dolar yukseliyor mu?','http://img.bigpara.com/c/1/70/650x365/bp/12102015_dolar4.jpg','lavinia_tromp'),(4,'Olduk bittik.','2019-12-24 12:19:57','Bu Dolarin Hali Ne Olacak?','https://s3.eu-central-1.amazonaws.com/traderx/1577189996141-560563950.jpeg','mstfalp'),(5,'When the United States declared China a currency manipulator on Monday, long-building trade tensions between the world’s two largest economies spread to the combustible realm of currencies — with potentially huge consequences for the global financial system should the escalation continue.\n\nOn Wednesday there was just such an escalation. Central banks in India, New Zealand and Thailand cut interest rates, aiming to protect their economies from the fallout of the trade and currency war. And bad numbers on industrial production in Germany heightened fears of a recession in Europe. Money flooded into safe assets, especially United States Treasury bonds.\n\nBut the wave of worry around the world has its roots in the increasingly fraught relationship between China and the United States.','2019-12-24 12:58:14','Upon rising dollar...','','enozcan'),(6,'Japan’s currency, the yen, is the third most commonly used currency in the world, behind the U.S. dollar and euro.  For decades, it has been seen as the proxy for Asia. Although China’s currency, the yuan, is rapidly growing in importance, its managed status and general lack of flexibility means the Japanese yen is still the preferable Asian reserve currency over the yuan.  \n\nIt is also the fourth most popular reserve currency behind the U.S. dollar, euro and sterling. This is very important because when there is political or economic uncertainty in Asia, investors usually express their views through the Japanese Yen. So if breaking news causes a crisis of confidence, there will be big moves in Japan’s currency, even if the problems are not in Japan.','2019-12-24 13:01:23','Why the Japanese Yen Matters?','https://newsskill.com/wp-content/uploads/2019/12/Japanese-Yen.jpg','enozcan'),(7,'The Japanese Yen is rising from increased safe-haven flows as a global stock market rout takes hold, with analysts at investment bank Morgan Stanley saying they see the trend of appreciation accelerating as domestic investors take out further currency hedges.\n\nNewfound fears of a slowdown in the U.S. economy has meanwhile reduced the competitive appeal of the Dollar which used to be the safe-haven of choice for investors.\n\nNow other safe-haven alternatives - by which it is meant assets which rise in a crisis - such as the Yen and gold are benefiting as a consequence. Be aware of the incoming trade war though. \n\nThis is reflected in the USD/JPY rate, which is trading 1.13% lower on the day at the time of writing, at 106.70.','2019-12-24 13:26:22','What about Japanese Yen? ','https://www.fx-exchange.com/currencyimages/usd-jpy-90-day-exchange-rates-history-graph.png','donald'),(8,'Congressional appropriators said the deal includes a 2.6% across-the-board increase in base pay with an additional 0.5% in locality adjustments, for a total average of 3.1%. If passed into law, raises would go into effect on the first applicable pay period of the new year.\n\nThe federal pay raise is a key component of one of two “minibus” spending bills, which House and Senate negotiators unveiled Monday evening as they announced the final agreement that both chambers plan to vote on this week before sending the measure to the president.','2019-12-24 13:50:34','Dollar in Next Term?\n','https://s3.eu-central-1.amazonaws.com/traderx/1577195433677--271868893.jpeg','donald'),(9,'Seems like it is down.','2019-12-24 17:31:25','X Center Down?','https://s3.eu-central-1.amazonaws.com/traderx/1577208685069--1629325885.jpeg','donald'),(10,'Merhaba bu uygulama çok güzel iyi ki var böyle bir şey.\n\nAncak size şunu söyleyeyim TR570006701000000086404732 nolu ibanımı girdiğimde hata alıyorum. Lütfen çözün bunu yoksa oturup ağlayacağım. :(','2019-12-28 18:48:40','Aslan Kral ne zaman dönecek?','https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwibtuPxgNnmAhWuPOwKHXywDe4QjRx6BAgBEAQ&url=https%3A%2F%2Fanalyticsindiamag.com%2Ftop-5-libraries-for-image-processing-in-java%2F&psig=AOvVaw1tj72S0lcmIWY_fQLO9H6w&ust=1577645286631190','uzunHasan'),(11,'A weak yen enhances the competitive advantage of Japan\'s export sector by making yen-denominated products cheaper for overseas buyers. It also exercises an inflationary influence on the prices of foreign goods imported into Japan, thus helping the Bank of Japan\'s (BOJ) pursuit of higher inflation.','2019-12-30 14:28:31','About Japanese Yen','https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQo0_o7QTe8yLTp4dNmL57Y6Dmp_2p8_y3gEzD-SEtjtf6h21U9','irmakguzey'),(12,'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.','2020-01-01 17:58:00','Introduction to Trading Equipments','https://s3.eu-central-1.amazonaws.com/traderx/1577901480255-1019642177.jpeg','adamswitch');
